import React,{Component} from 'react';
import BiceLabel from '../../src/componentes/biceLabel';

class BiceValores extends Component {
    constructor(props) {
      super(props);
      this.state = {
            };
    }
  
    render() {
      return (
        <div>
          
          <div className="row">

            <BiceLabel valor="UF=" nombre="1.3456"/>
            <BiceLabel valor="Pesos=" nombre="1.1456"/>
            <BiceLabel valor="Dolar=" nombre="1.2456"/>
            <BiceLabel valor="Dolar1=" nombre="1.2456"/>
         </div>         



              <div className="card text-white bg-primary mb-5" >
                <form action="/" method="get" >
                    <button className="btn btn-primary"type="submit">Volver</button>
                </form>                
              </div>         
            </div>
      );
    }
  }
export default BiceValores;
